- **S1**: Connection established, not terminated
- **SF**: Normal establishment and termination (with bytes)
- **S1**: Normal establishment and termination (no bytes)
- **S2**: Connection established and close attempt by originator seen
- **S3**: Connection established and close attempt by responder seen
- **RSTO**: Connection established, originator aborted
- **RSTR**: Responder sent a RST
- **RSTOS0**: Originator sent a SYN followed by a RST
- **RSTRH**: Responder sent a SYN ACK followed by a RST
- **SH**: Originator sent a SYN followed by a FIN
- **SHR**: Responder sent a SYN ACK followed by a FIN
- **OTH**: No SYN seen, just midstream traffic"},"uiState":{},"data":{"aggs":[],"searchSource":{"query":{"query":"","language":"kuery"},"filter":[]}}},"hidePanelTitles":false,"enhancements":{}},"title":"Zeek Connection States"},{"version":"7.15.2","type":"visualization","gridData":{"x":29,"y":50,"w":9,"h":16,"i":"f8065d4b-d0e1-4c8a-be7e-3ac88666ed55"},"panelIndex":"f8065d4b-d0e1-4c8a-be7e-3ac88666ed55","embeddableConfig":{"savedVis":{"title":"","description":"","type":"table","params":{"perPage":10,"showPartialRows":false,"showMetricsAtAllLevels":false,"showTotal":false,"showToolbar":false,"totalFunc":"sum","percentageCol":""},"uiState":{},"data":{"aggs":[{"id":"1","enabled":true,"type":"count","params":{},"schema":"metric"},{"id":"2","enabled":true,"type":"terms","params":{"field":"zeek.connection.history","orderBy":"1","order":"desc","size":10,"otherBucket":false,"otherBucketLabel":"Other","missingBucket":false,"missingBucketLabel":"Missing","customLabel":"Conn History"},"schema":"bucket"}],"searchSource":{"index":"969aeec0-5865-11ec-b950-7764f0922dd7","query":{"query":"","language":"kuery"},"filter":[]}}},"hidePanelTitles":false,"enhancements":{}},"title":"Top Zeek Connection History"},{"version":"7.15.2","type":"visualization","gridData":{"x":38,"y":50,"w":10,"h":16,"i":"8d9aa2d1-7c1e-424f-996e-bcbd822cf204"},"panelIndex":"8d9aa2d1-7c1e-424f-996e-bcbd822cf204","embeddableConfig":{"savedVis":{"title":"","description":"","type":"markdown","params":{"fontSize":11,"openLinksInNewTab":false,"markdown":"- **s**: a SYN w/o the ACK bit set
- **h**: a SYN+ACK (“handshake”)
- **a**: a pure ACK
- **d**: packet with payload (“data”)
- **f**: packet with FIN bit set
- **r**: packet with RST bit set
- **c**: packet with a bad checksum (applies to UDP too)
- **g**: a content gap
- **t**: packet with retransmitted payload
- **w**: packet with a zero window advertisement
- **i**: inconsistent packet (e.g. FIN+RST bits set)
- **q**: multi-flag packet (SYN+FIN or SYN+RST bits set)
- **^**: connection direction was flipped by Zeek’s heuristic"},"uiState":{},"data":{"aggs":[],"searchSource":{"query":{"query":"","language":"kuery"},"filter":[]}}},"hidePanelTitles":false,"enhancements":{}},"title":"Zeek Connection History"},{"version":"7.15.2","type":"search","gridData":{"x":0,"y":66,"w":48,"h":19,"i":"390d13b6-e998-483b-a702-5f5a4e6de0a6"},"panelIndex":"390d13b6-e998-483b-a702-5f5a4e6de0a6","embeddableConfig":{"columns":["source.ip","source.port","destination.ip","destination.port","network.protocol"],"enhancements":{}},"panelRefName":"panel_390d13b6-e998-483b-a702-5f5a4e6de0a6"}]
